import React, {useEffect} from "react";


function ShoppingCart() {
  useEffect(()=> {

    async function getData() {
      let data = await fetch('/api/shopping-cart');
      data = await data.json();

      console.log(data);
    }

    getData();
  }, [])


  return (
    <div className="shopping-cart">
      <h1>
        Här är dina varor!
      </h1>
    </div>
  )
}

export default ShoppingCart;
